import logo from './logo2.svg';
import './App.css';
const openmoji = require('openmoji');

const om = openmoji.openmojis[0];

var image = "/images/" + String(om.hexcode) + "./svg";
console.log(image);

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <img src=<code>image</code> className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
          Bet this looks pretty cool huh? {om.openmoji_images.color.svg}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
